// Solution 1:
const moveElementToEnd = (arr, toMove) => {
    let left = 0;
    let right = arr.length - 1;

    while(left < right){
        if(arr[right] === toMove && arr[left]!== toMove){
            [arr[left], arr[right]] = [arr[right], arr[left]];
            left++;
            right--;
        } else if(arr[right]!== toMove){
            right--;
        } else{
            right--;
        }
    }

    return arr;
}

console.log(moveElementToEnd(['h', 'h', 'h', 'a', 'a', 'a', 'j'], 'a')) // ['a', 'a', 'a', 'h', 'h', 'h', 'j']
console.log(moveElementToEnd(['d', 'd', 'd', 'a', 'a', 'j', 'a'], 'a')) // ['a', 'a', 'd', 'd', 'd', 'j', 'a']
console.log(moveElementToEnd(['i', 'i', 'i', 'a', 'a', 'a', 'j'], 'a')) // ['a', 'a', 'a', 'i', 'i', 'i', 'j']
console.log(moveElementToEnd(['f', 'f', 'f', 'a', 'a', 'j', 'a'], 'a')) // ['a', 'a', 'f', 'f', 'f', 'j', 'a']
